var linestyle ={
    "color": "black",
    "weight": 5
};

var oilPipeLines = L.geoJSON(oilLines, {
    style: linestyle,
    onEachFeature: function(feature, layer) {
        var popupContent = '<h4>' + feature.properties.Opername + '</h4>' + '<br>' + '<p>' + feature.properties.Pipename + '<p>' + '</br>' + 'Price: $' + feature.properties.SHAPE_Length * 100;
        layer.bindPopup(popupContent);
    }
});

oilPipeLines.addTo(map);


var pipelineListDiv = document.getElementById("pipelineList");
var features = oilLines[0].features;
var ul = document.createElement("ul");

features.forEach(function(feature) {
    var opername = feature.properties.Opername;
    var pipename = feature.properties.Pipename;

    var li = document.createElement("li");
    li.classList.add("list-item");

    var operNameElement = document.createElement("span");
    operNameElement.classList.add("oper-name");
    operNameElement.textContent =  opername;

    var pipeNameElement = document.createElement("span");
    pipeNameElement.classList.add("pipe-name");
    pipeNameElement.textContent = pipename;

    var lineBreak = document.createElement("br");

    li.appendChild(operNameElement);
    li.appendChild(lineBreak);
    li.appendChild(pipeNameElement);

    li.addEventListener('click', function() {
        var coordinates = feature.geometry.coordinates[0][0];
        var swappedCoordinates = [coordinates[1], coordinates[0]]; 
        map.flyTo(swappedCoordinates, 13); 
        layer.openPopup();
    });

    ul.appendChild(li);
});

pipelineListDiv.appendChild(ul);
